import fire from '../../config/Fire';



function Home(props) {

const logout = () => {
    fire.auth().signOut();
}

  return(
    <div className="container py-5">
        <div className="row justiy-content-center">
            <div className="col-md-10">
               <h2>hello</h2>
               <button className="btn btn-primary" onClick={logout}>LogOut</button>
            </div>
        </div>

    </div>
  );

}

export default Home;
